import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Select from 'react-select';
import ReactPaginate from 'react-paginate';
import './App.css';

function App() {
  const [allProducts, setAllProducts] = useState([]);
  const [cultura, setCultura] = useState(null);
  const [daunator, setDaunator] = useState(null);
  const [culturaOptions, setCulturaOptions] = useState([]);
  const [daunatorOptions, setDaunatorOptions] = useState([]);
  const [currentPage, setCurrentPage] = useState(0);
  const itemsPerPage = 10;

  const fetchData = async () => {
    const response = await axios.get('http://localhost:5000/api/products');
    const allData = response.data;

    const culturi = new Set();
    const daunatori = new Set();

    allData.forEach(p => {
      p['Cultura Omologata']?.split(/[,|]/).forEach(val => culturi.add(val.trim()));
      p['Daunatori Omologati']?.split(/[,|]/).forEach(val => daunatori.add(val.trim()));
    });

    setCulturaOptions(Array.from(culturi).map(c => ({ value: c, label: c })));
    setDaunatorOptions(Array.from(daunatori).map(d => ({ value: d, label: d })));
    setAllProducts(allData);
  };

  useEffect(() => {
    fetchData();
  }, []);

  const filteredProducts = allProducts.filter(p => {
    const matchCultura = !cultura || p['Cultura Omologata']?.includes(cultura.value);
    const matchDaunator = !daunator || p['Daunatori Omologati']?.includes(daunator.value);
    return matchCultura && matchDaunator;
  });

  const pageCount = Math.ceil(filteredProducts.length / itemsPerPage);
  const offset = currentPage * itemsPerPage;
  const currentItems = filteredProducts.slice(offset, offset + itemsPerPage);
  const handlePageClick = ({ selected }) => setCurrentPage(selected);

  const formatList = (text) => {
    const values = text
      ?.split(/[,|]/)
      .map(item => item.trim())
      .filter(Boolean);
    const unique = Array.from(new Set(values));
    return unique.map((item, idx) => <div key={idx}>{item}</div>);
  };

  const formatDoze = (text) => {
    const values = text
      ?.split('|')
      .map(item => item.trim())
      .filter(Boolean);
    const unique = Array.from(new Set(values));
    return unique.map((item, idx) => <div key={idx}>{item}</div>);
  };

  return (
    <div>
      <h1>Produse Fitosanitare</h1>

      <form onSubmit={(e) => { e.preventDefault(); setCurrentPage(0); }}>
        <div style={{ display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
          <Select
            placeholder="Filtru Cultura"
            options={culturaOptions}
            value={cultura}
            onChange={(selected) => setCultura(selected)}
            isClearable
          />
          <Select
            placeholder="Filtru Daunator"
            options={daunatorOptions}
            value={daunator}
            onChange={(selected) => setDaunator(selected)}
            isClearable
          />
          <button type="submit">Caută</button>
        </div>
      </form>

      <table border="1">
        <thead>
          <tr>
            <th>Denumire</th>
            <th>Cultura Omologata</th>
            <th>Daunatori Omologati</th>
            <th>Doze Omologate</th>
          </tr>
        </thead>
        <tbody>
          {currentItems.map((prod, idx) => (
            <tr key={idx}>
              <td>{prod.Denumire}</td>
              <td>{formatList(prod['Cultura Omologata'])}</td>
              <td>{formatList(prod['Daunatori Omologati'])}</td>
              <td>{formatDoze(prod['Doze Omologate'])}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <ReactPaginate
        previousLabel={"←"}
        nextLabel={"→"}
        pageCount={pageCount}
        onPageChange={handlePageClick}
        containerClassName={"pagination"}
        activeClassName={"active"}
        pageRangeDisplayed={3}
        marginPagesDisplayed={1}
      />
    </div>
  );
}

export default App;
